import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext
//run test step
def teststepper = testRunner.testCase.testSuite.testCases["getEmployee TestCase"].testSteps["getEmployeeDetails"]
def teststeprunner = new WsdlTestRunContext(teststepper)
teststepper.run(testRunner, teststeprunner)//location run testrunner because it is another test case and the context object to run

//extract value of name in response

def xmlresp = testRunner.testCase.testSuite.testCases["getEmployee TestCase"].testSteps["getEmployeeDetails"].getPropertyValue("Response")
def xmlholdresp = new XmlHolder(xmlresp)


def nameinresp = xmlholdresp.getNodeValue("//ns:name")
//extract name value from testsuite 
def nameinsuite = testRunner.testCase.testSuite.getPropertyValue("name")

assert nameinsuite == nameinresp
